import React from "react";
import Col from "react-bootstrap/Col";

//import { Link } from "react-router-dom";

const EuromillonCard = ({euromillon:{numeros,  estrellas, millon}
}) => {
  return (
    <Col className="coaster-card" md={4}>
      <h3>Resultado del Euromillon</h3>
      <p>{euromillon.numeros}</p> <p>{euromillon.estrellas}</p> <p>{euromillon.millon}</p>
    </Col>
  );
};

export default EuromillonCard;
